/// <summary>
/// Method to initialize dimensions fields on temporary work line table
/// </summary>
/// <param name="_inventDim">
/// Dimension set used to initialize values on temporary work line table
/// </param>
public void initFromInventDim(InventDim _inventDim)
{
    this.InventDimFieldsMap::initAllDimensionsFrom(_inventDim);
    this.InventDimId = _inventDim.InventDimId;
}

/// <summary>
/// Initializes the InventQty, DirectiveQty and DirectiveUOM fields of the current tmp work line,
/// based on the requested quantity and the quantity on the current location if specified.
/// </summary>
/// <param name = "_totalRequestedQty">The total requested quantity to be set to the tmp quantity fields</param>
/// <param name = "_qtyOnCurrentLocation">The quantity on the current location</param>
/// <param name = "_unitId">The unit ID to be set</param>
/// <param name = "_inventQty">The inventory quantity to be set if there is no location specified yet</param>
public void initInventAndDirectiveQuantities(
                                    Qty                 _totalRequestedQty,
                                    Qty                 _qtyOnCurrentLocation,
                                    UnitOfMeasureSymbol _unitId,
                                    Qty                 _inventQty)
{
    if (this.WMSLocationId)
    {
        this.InventQty            = _inventQty;
        this.DirectiveQty         = _qtyOnCurrentLocation;
        this.DirectiveUOM         = _unitId;
    }
    else
    {
        this.InventQty            = _totalRequestedQty;
        this.DirectiveQty         = _totalRequestedQty;
        this.DirectiveUOM         = WHSCatchWeightHelper::inventHandlingUnitId(this.ItemId);
    }
}

    /// <summary>
    /// Method that initialized order committed dimensions on a work detail line.
    /// </summary>
    [Hookable(false)]
	internal void initOrderCommittedDimensions()
    {
        InventDim inventDim = InventDim::find(this.OrderCommittedInventDimId);
        this.OrderCommittedLicensePlateId = inventDim.LicensePlateId;
        this.OrderCommittedBatchId = inventDim.inventBatchId;
        this.OrderCommittedSerialId = inventDim.inventSerialId;
    }

/// <summary>
///     Initializes the Production specific fields on the Temp Work Line.
/// </summary>
/// <param name = "_pmfProductType">Product type.</param>
/// <remarks>
///     The OriginType and WorkTransType fields are initialized based on _pmfProductType.
/// </remarks>
[Replaceable]
public final void initializeTempWorkLineByPmfProductType(PmfProductType _pmfProductType)
{
    switch (_pmfProductType)
    {
        case PmfProductType::BOM:
        case PmfProductType::None:
            this.OriginType       = WHSOriginType::Production;
            this.WorkTransType    = WHSWorkTransType::ProdPut;
            break;

        case PmfProductType::Formula:
            this.OriginType       = WHSOriginType::ProcessProduction;
            this.WorkTransType    = WHSWorkTransType::ProdPut;
            break;

        case PmfProductType::By_Product:
        case PmfProductType::Co_Product:
            this.OriginType       = WHSOriginType::ProcessProduction;
            this.WorkTransType    = WHSWorkTransType::ProdProcessPut;
            break;
        default:
            throw error(Error::wrongUseOfFunction(funcName()));
    }
}

/// <summary>
/// Initializes the <c>PackQtyCompare</c> field based on the inventory and packing quantities.
/// </summary>
public void setPackQtyCompare()
{
    if (this.InventQty == this.PackingQty)
    {
        this.PackQtyCompare = WHSPackQtyCompare::EqualTo;
    }
    else if (this.InventQty < this.PackingQty)
    {
        this.PackQtyCompare = WHSPackQtyCompare::LessThan;
    }
    else
    {
        this.PackQtyCompare = WHSPackQtyCompare::GreaterThan;
    }
}

/// <summary>
/// Initializes the fields related to the specified location.
/// </summary>
/// <param name = "_locationId">The location ID to be set</param>
/// <param name = "_warehouseId">The warehouse ID of the location</param>
public void setWMSLocation(WMSLocationId _locationId, InventLocationId _warehouseId)
{
    WMSLocation wmsLocation = WMSLocation::find(_locationId, _warehouseId);

    if (wmsLocation)
    {
        this.wmsLocationId = wmsLocation.wMSLocationId;
        this.SortCode      = wmsLocation.SortCode;
        this.ZoneId        = wmsLocation.ZoneId;
    }
    else
    {
        this.wmsLocationId = '';
        this.SortCode      = 0;
        this.ZoneId        = '';
    }
}

    /// <summary>
	/// Sets line number of the record.
	/// </summary>
    public void setLineNum()
    {
        this.LineNum = this.getLastLineNum() + 1;
    }

public LineNum getLastLineNum()
{
    Debug::assert(this.WorkCreateId != '');

    WHSTmpWorkLine tmpWorkLine;

    select maxof(LineNum) from tmpWorkLine
        where tmpWorkLine.WorkCreateId == this.WorkCreateId;

    return tmpWorkLine.LineNum;
}

    /// <summary>
	/// Finds a specific <c>WHSTmpWorkLine</c> record with given parameters.
	/// </summary>
	/// <param name="_workCreateId">
	/// Work creation id of the record.
	/// </param>
	/// <param name="_lineNum">
	/// Line number of the record.
	/// </param>
	/// <param name="_forUpdate">
	/// Determines whether the record is selected for update.
	/// </param>
	/// <returns>
	/// The record that is searched for.
	/// </returns>
    public static WHSTmpWorkLine find(WHSWorkCreateId _workCreateId, LineNum _lineNum, boolean _forUpdate = false)
    {
        WHSTmpWorkLine   tmpWorkLine;

        if (_workCreateId && _lineNum)
        {
            tmpWorkLine.selectForUpdate(_forUpdate);

            select firstonly tmpWorkLine
                where tmpWorkLine.WorkCreateId      == _workCreateId &&
                      tmpWorkLine.LineNum           == _lineNum;
        }

        return tmpWorkLine;
    }

    /// <summary>
	/// Finds a specific <c>WHSTmpWorkLine</c> record by id.
	/// </summary>
	/// <param name="_recId">
	/// Id of the record.
	/// </param>
	/// <param name="_forUpdate">
	/// Determines whether the record is selected for update.
	/// </param>
	/// <returns>
	/// The record that is searched for.
	/// </returns>
    public static WHSTmpWorkLine findByRecId(RecId _recId, boolean _forUpdate = false)
    {
        WHSTmpWorkLine   tmpWorkLine;

        if (_recId)
        {
            tmpWorkLine.selectForUpdate(_forUpdate);

            select firstonly tmpWorkLine
                where tmpWorkLine.RecId == _recId;
        }

        return tmpWorkLine;
    }

/// <summary>
/// Gets the guide license plates for the work line from the load
/// </summary>
/// <returns>
/// List containing guide license plates
/// </returns>
public List getGuideLicensePlatesfromLoad()
{
    WHSLoadline whsLoadLine;

    if (this.RefTableId != whsLoadLine.TableId)
    {
        return null;
    }

    whsLoadLine = WHSLoadLine::findbyRecId(this.RefRecId);

    if (!whsLoadLine)
    {
        return null;
    }

    return whsLoadLine.getRequestedLicensePlates();
}

public static void cleanupTmpWorkLines(WHSWorkCreateId _workCreateId)
{
    WHSTmpWorkLine          locTmpWorkLine;

    if (WHSParameters::find().RetainTmpWorkTable)
    {
        while select locTmpWorkLine
            where locTmpWorkLine.WorkCreateId == _workCreateId
        {
            WHSTmpWorkLineHistory tmpWorkLineHistory;
            tmpWorkLineHistory.initFromWHSTmpWorkLine(locTmpWorkLine);
            tmpWorkLineHistory.insert();
        }
    }

    delete_from locTmpWorkLine
        where locTmpWorkLine.WorkCreateId == _workCreateId;
}

/// <summary>
/// Cleans up records for a <c>ReleaseToWarehouseId</c>.
/// </summary>
/// <param name = "_releaseToWarehouseId">The <c>ReleaseToWarehouseId</c> to clean up for.</param>
public static void cleanupTmpWorkLinesForReleaseToWarehouseId(WHSReleaseToWarehouseId _releaseToWarehouseId)
{
    #OCCRetryCount

    try
    {
        ttsbegin;

        WHSTmpWorkLine tmpWorkLine;

        delete_from tmpWorkLine
            where tmpWorkLine.ReleaseToWarehouseId == _releaseToWarehouseId;

        ttscommit;
    }
    catch (Exception::Deadlock)  // Can occur if delete_from locks rows that will not be deleted - i.e. a sub-optimal query plan.
    {
        if (xSession::currentRetryCount() >= #RetryNum)
        {
            throw;
        }
        else
        {
            retry;
        }
    }
    catch (Exception::TransientSqlConnectionError)
    {
        if (ReqTransientSqlConnectionErrorHandlingHelper::retryTransientSqlConnectionError(#RetryNum))
        {
            retry;
        }
        else
        {
            throw;
        }
    }
}

/// <summary>
/// Determines if the work respective to the <c>WHSTmpWorkLine</c> record is using replenishment overflow.
/// </summary>
/// <param name = "_wmsLocation">
/// <c>WMSLocation</c> record.
/// </param>
/// <returns>
/// true if the put is for replenishment overflow; otherwise, false.
/// </returns>
[Hookable(false)]
internal boolean isReplenishmentOverflowWorkLine(WMSLocation _wmsLocation)
{
    return this.isReplenishmentPut()
        && _wmsLocation.isReplenishmentOverflowEnabled();
}

private boolean isReplenishmentPut()
{
    return this.WorkType == WHSWorkType::Put
        && this.WorkTransType == WHSWorkTransType::Replenishment;
}

/// <summary>
/// Finds the first put temporary work line for a provided work ID.
/// </summary>
/// <param name="_workId">
/// The work ID.
/// </param>
/// <returns>
/// The first put temporary work line.
/// </returns>
internal static WHSTmpWorkLine getFirstPutTmpWorkLine(WHSWorkId _workId)
{
    return WHSTmpWorkLine::getFirstTmpWorkLineByType(_workId, WHSWorkType::Put);
}

private static WHSTmpWorkLine getFirstTmpWorkLineByType(WHSWorkId _workId, WHSWorkType _workType)
{
    WHSTmpWorkLine tmpWorkLine;

    select firstonly tmpWorkLine
        order by tmpWorkLine.LineNum asc
        where tmpWorkLine.WorkId == _workId
            && tmpWorkLine.WorkType == _workType;

    return tmpWorkLine;
}

/// <summary>
/// Instantiates an item key object based on the product associated with the current line.
/// </summary>
/// <returns>
/// The <c>InventItemKey</c> object.
