[Hookable(false)]
final public InventItemKey itemKey()
{
    return InventItemKey::newFromItem(this.ItemId, this.InventDimId);
}

[Hookable(false)]
internal final boolean isUsedForCrossDocking()
{
    boolean usedForCrossDocking;

    switch (this.WorkTransType)
    {
        case WHSWorkTransType::Purch:
            if (WHSCrossDockLoadLine::existsForSupplyInventTransOriginId(InventTransOrigin::findByInventTransId(this.InventTransId).RecId))
            {
                usedForCrossDocking = true;
            }
            break;
        case WHSWorkTransType::TransferReceipt:
            InventTransferLine inventTransferLine = InventTransferLine::findTransIdShip(this.InventTransId);
            if (WHSCrossDockLoadLine::existsForSupplyInventTransOriginId(InventTransOrigin::findByInventTransId(inventTransferLine.InventTransIdReceive).RecId))
            {
                usedForCrossDocking = true;
            }
            break;
        default:
            usedForCrossDocking = true;
            break;
    }

    return usedForCrossDocking;
}

