/// Determines if concurrent deletes should throw exception.
/// </summary>
/// <returns>true if exception should be thrown; otherwise false.</returns>
[Hookable(false)]
public boolean shouldThrowExceptionOnZeroDelete()
{
    return true;
}

/// <summary>
/// Deletes temporary work line record.
/// </summary>
[Hookable(false)]
internal void deleteDemandWorkLine()
{
    WHSLoadLine::decrementWaveUpdatedLoadLineWorkCreatedQty(this.LoadLineRefRecId, this.InventQty, this.WaveId);

    if (this.WorkTransType == WHSWorkTransType::KanbanPick)
    {
        WHSKanbanJobPickingListPool::reduceWavedQty(this.InventTransId, this.InventQty);
    }

    this.delete();
}

internal void setWorkBreakWithReread(boolean _workBreak)
{
    this.reread();
    this.WorkBreak = _workBreak;
    this.update();
}
